import React from "react";
import {Link} from 'react-router-dom';
import "./error.css";


const Error = () => {
	return (

		<section className="page_404">
		
			<Link to="/" ><h1>Home</h1></Link>
			<div className="img-asd">
			</div>
			

		</section>
	)
};


export default Error;
